                <h5><a>Hiring in a hurry? - </a></h5>
                <p>
                    Find talented pros in record time with Upwork and keep business
                    moving.
                </p>
            </Selection>
        </Container>
    );
};

const Container = styled.div`

`;

const Content = styled.div`

`;

const Selection = styled.selection`

`;

export default Home;
